import React from "react";

function Item(props) {
  console.log(props.id);
  return (
      <tr>
    <td><img src={props.img}/></td>
    <td>{props.name}</td>
    <td>{props.price}</td>
    <td><input type="number" defaultValue="1" id={Object.keys(props)}></input></td>
    <td><input type="checkbox" id={props.name}></input></td>
    </tr>
  );
}

export default Item;
